import WomanDesigning from "../../../assets/images/woman-designing.jpg.jpg";

const About = () => {
    return (
        <main className="about">
            <h1 className="about__title">Contact</h1>
            <section className="about__text">
                <p>If you have media queries about my books or want to discuss illustrations for your own books or merchandise,
                    please contact me using hello@readchastain.com</p>
            </section>
            <section>
                <img className="about__image" src={WomanDesigning} alt="woman designing" />
            </section>
        </main>
    );
};

export default About;
